import image from './2023.png';
import './home.css';
import img from './img.svg';
import Offers from './offers.js';
import React from 'react';
import ReactDOM from 'react-dom/client';
import reportWebVitals from './reportWebVitals';
function Home(){
    return (
        <>
        <div className='home-box'>
            <div className='about'>
                 <div className='top-offer' id='top-offer'></div>
                <img className='img' src={img}/>
            </div>
        </div>
        </>
    );
}
let home_containe = document.getElementById("top-offer");
let home_root = ReactDOM.createRoot(home_containe);
home_root.render(<Offers />);
export default Home;
